import React, { useState, useEffect } from 'react';

const API_BASE_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000/api';

const COLUMNS = {
  orderId: 'Order ID',
  purchaseTimestamp: 'Purchase Timestamp',
  reviewScore: 'Review Score',
  deliveredOnTime: 'Delivered On Time',
  paymentType: 'Payment Type',
  paymentValue: 'Payment Value',
  shippingCost: 'Shipping Cost',
  productCategory: 'Product Category',
  customerState: 'Customer State',
  customerId: 'Customer ID',
  orderStatus: 'Order Status',
  deliveryDurationDays: 'Time to Deliver to Customer Days'
};

export default function DebugDashboard() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [expandedSections, setExpandedSections] = useState({
    api: true,
    columns: true,
    sample: true,
    states: true,
    stats: true
  });

  useEffect(() => {
    const fetchData = async () => {
      try {
        console.log('üåê [DEBUG] Attempting to fetch from:', API_BASE_URL + '/data');
        const response = await fetch(`${API_BASE_URL}/data`);

        console.log('üì° [DEBUG] Response received:', {
          status: response.status,
          statusText: response.statusText,
          ok: response.ok,
          headers: {
            contentType: response.headers.get('content-type'),
            contentLength: response.headers.get('content-length')
          }
        });

        if (!response.ok) {
          throw new Error(`HTTP ${response.status}: ${response.statusText}`);
        }

        const rawData = await response.json();

        console.log('üì¶ [DEBUG] Data parsed:', {
          isArray: Array.isArray(rawData),
          length: rawData?.length || 'N/A',
          type: typeof rawData,
          firstRecord: rawData?.[0] || 'NONE'
        });

        setData(Array.isArray(rawData) ? rawData : []);
        setError(null);
      } catch (err) {
        console.error('‚ùå [DEBUG] Error occurred:', {
          message: err.message,
          stack: err.stack,
          name: err.name
        });
        setError(err.message);
        setData([]);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  const toggleSection = (section) => {
    setExpandedSections(prev => ({
      ...prev,
      [section]: !prev[section]
    }));
  };

  const Section = ({ title, section, children }) => (
    <div style={{ marginBottom: '20px', border: '1px solid #cbd5e1', borderRadius: '8px', overflow: 'hidden' }}>
      <div
        onClick={() => toggleSection(section)}
        style={{
          padding: '12px 16px',
          backgroundColor: '#e5e7eb',
          cursor: 'pointer',
          fontWeight: 'bold',
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center'
        }}
      >
        <span>{title}</span>
        <span>{expandedSections[section] ? '‚ñº' : '‚ñ∂'}</span>
      </div>
      {expandedSections[section] && (
        <div style={{ padding: '16px', backgroundColor: '#f9fafb' }}>
          {children}
        </div>
      )}
    </div>
  );

  const InfoBox = ({ label, value, color = '#3b82f6' }) => (
    <div style={{ marginBottom: '8px', padding: '8px', backgroundColor: '#f3f4f6', borderLeft: `4px solid ${color}`, borderRadius: '4px' }}>
      <div style={{ fontSize: '12px', color: '#6b7280' }}>{label}</div>
      <div style={{ fontSize: '14px', fontWeight: 'bold', color: '#1f2937', marginTop: '4px', wordBreak: 'break-all' }}>
        {typeof value === 'object' ? JSON.stringify(value, null, 2) : String(value)}
      </div>
    </div>
  );

  if (loading) {
    return (
      <div style={{ padding: '40px', textAlign: 'center', fontFamily: 'monospace' }}>
        <div style={{ fontSize: '24px', marginBottom: '10px' }}>‚è≥ Loading...</div>
        <div>Fetching data from {API_BASE_URL}/data</div>
      </div>
    );
  }

  const actualColumns = data.length > 0 ? Object.keys(data[0]) : [];
  const stateValues = data.length > 0 ? [...new Set(data.map(d => d?.[COLUMNS.customerState]).filter(Boolean))] : [];
  const allStateValues = data.length > 0 ? [...new Set(data.map(d => Object.values(d).filter(v => typeof v === 'string' && v.length <= 3)).flat())] : [];

  const stateFrequency = {};
  data.forEach(record => {
    Object.values(record).forEach(value => {
      if (typeof value === 'string' && value.length <= 3 && value.match(/^[A-Z]{2}$/)) {
        stateFrequency[value] = (stateFrequency[value] || 0) + 1;
      }
    });
  });

  return (
    <div style={{ padding: '20px', fontFamily: 'monospace', backgroundColor: '#f3f4f6', minHeight: '100vh' }}>
      <h1 style={{ textAlign: 'center', color: '#1f2937' }}>üîç E-Commerce Dashboard Debug Center</h1>

      {/* API Status */}
      <Section title="üåê API Connection Status" section="api">
        {error ? (
          <div style={{ padding: '16px', backgroundColor: '#fee2e2', border: '1px solid #fca5a5', borderRadius: '6px', color: '#991b1b' }}>
            <div style={{ fontWeight: 'bold', marginBottom: '8px' }}>‚ùå CONNECTION ERROR</div>
            <div>{error}</div>
            <div style={{ marginTop: '10px', fontSize: '12px', color: '#7f1d1d' }}>
              <div>Troubleshooting:</div>
              <ul style={{ marginLeft: '20px', marginTop: '8px' }}>
                <li>Is your backend running on http://localhost:5000?</li>
                <li>Check CORS settings if on different domain</li>
                <li>Verify API endpoint: {API_BASE_URL}/data</li>
                <li>Check browser Console (F12) for network errors</li>
              </ul>
            </div>
          </div>
        ) : (
          <>
            <InfoBox label="API Base URL" value={API_BASE_URL} color="#10b981" />
            <InfoBox label="Status" value="‚úÖ Connected" color="#10b981" />
            <InfoBox label="Records Loaded" value={data.length} color="#3b82f6" />
          </>
        )}
      </Section>

      {/* Expected vs Actual Columns */}
      <Section title="üìã Column Mapping Analysis" section="columns">
        <div style={{ marginBottom: '16px' }}>
          <div style={{ fontWeight: 'bold', marginBottom: '8px', color: '#1f2937' }}>Expected Columns (from COLUMNS object):</div>
          <div style={{ padding: '12px', backgroundColor: '#dbeafe', borderRadius: '6px', fontSize: '12px' }}>
            {Object.entries(COLUMNS).map(([key, value]) => (
              <div key={key} style={{ marginBottom: '4px' }}>
                <span style={{ color: '#0284c7', fontWeight: 'bold' }}>{key}:</span> "{value}"
              </div>
            ))}
          </div>
        </div>

        <div style={{ marginBottom: '16px' }}>
          <div style={{ fontWeight: 'bold', marginBottom: '8px', color: '#1f2937' }}>Actual Columns (from API data):</div>
          {actualColumns.length === 0 ? (
            <div style={{ padding: '12px', backgroundColor: '#fee2e2', borderRadius: '6px', color: '#991b1b' }}>
              ‚ùå No data loaded - cannot determine columns
            </div>
          ) : (
            <div style={{ padding: '12px', backgroundColor: '#f0fdf4', borderRadius: '6px', fontSize: '12px' }}>
              {actualColumns.map(col => {
                const expectedValue = Object.values(COLUMNS).find(v => v === col);
                const matches = expectedValue ? '‚úÖ' : '‚ö†Ô∏è';
                return (
                  <div key={col} style={{ marginBottom: '4px', color: expectedValue ? '#059669' : '#b45309' }}>
                    {matches} "{col}"
                  </div>
                );
              })}
            </div>
          )}
        </div>

        <div style={{ padding: '12px', backgroundColor: '#fef3c7', borderRadius: '6px', fontSize: '12px', color: '#92400e' }}>
          <div style={{ fontWeight: 'bold', marginBottom: '6px' }}>‚ö†Ô∏è Column Issues:</div>
          {actualColumns.length === 0 ? (
            <div>No columns detected - data not loading</div>
          ) : (
            <>
              {actualColumns.filter(col => !Object.values(COLUMNS).includes(col)).length > 0 && (
                <div>
                  Found {actualColumns.filter(col => !Object.values(COLUMNS).includes(col)).length} unexpected columns
                </div>
              )}
              {!actualColumns.includes(COLUMNS.customerState) && (
                <div style={{ color: '#dc2626', fontWeight: 'bold' }}>
                  ‚ùå CRITICAL: Customer State column not found! Expected: "{COLUMNS.customerState}"
                </div>
              )}
              {actualColumns.length === Object.keys(COLUMNS).length && (
                <div style={{ color: '#059669' }}>‚úÖ All expected columns present</div>
              )}
            </>
          )}
        </div>
      </Section>

      {/* Sample Data */}
      <Section title="üì¶ Sample Records" section="sample">
        {data.length === 0 ? (
          <div style={{ padding: '12px', backgroundColor: '#fee2e2', borderRadius: '6px', color: '#991b1b' }}>
            ‚ùå No data to display
          </div>
        ) : (
          <>
            <InfoBox label="First 3 records (raw JSON)" value={JSON.stringify(data.slice(0, 3), null, 2)} color="#8b5cf6" />
            <div style={{ marginTop: '16px', padding: '12px', backgroundColor: '#f0f9ff', borderRadius: '6px' }}>
              <div style={{ fontWeight: 'bold', marginBottom: '8px' }}>Record #1 - Field by Field:</div>
              {data[0] && Object.entries(data[0]).map(([key, value]) => (
                <div key={key} style={{ marginBottom: '6px', fontSize: '12px' }}>
                  <span style={{ color: '#0284c7', fontWeight: 'bold' }}>{key}:</span> {JSON.stringify(value)}
                </div>
              ))}
            </div>
          </>
        )}
      </Section>

      {/* State Analysis */}
      <Section title="üó∫Ô∏è State/Location Analysis" section="states">
        {data.length === 0 ? (
          <div style={{ padding: '12px', backgroundColor: '#fee2e2', borderRadius: '6px', color: '#991b1b' }}>
            ‚ùå No data to analyze
          </div>
        ) : (
          <>
            <div style={{ marginBottom: '16px' }}>
              <div style={{ fontWeight: 'bold', marginBottom: '8px', color: '#1f2937' }}>
                Values in "{COLUMNS.customerState}" column:
              </div>
              {stateValues.length === 0 ? (
                <div style={{ padding: '12px', backgroundColor: '#fee2e2', borderRadius: '6px', color: '#991b1b' }}>
                  ‚ùå No state values found! Column may not exist or all values are null/empty
                </div>
              ) : (
                <div style={{ padding: '12px', backgroundColor: '#ecfdf5', borderRadius: '6px' }}>
                  <div style={{ marginBottom: '8px', fontSize: '12px', color: '#059669' }}>
                    Found {stateValues.length} unique state values:
                  </div>
                  <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fill, minmax(80px, 1fr))', gap: '8px' }}>
                    {stateValues.map(state => (
                      <div
                        key={state}
                        style={{
                          padding: '8px',
                          backgroundColor: '#d1fae5',
                          borderRadius: '4px',
                          textAlign: 'center',
                          fontWeight: 'bold',
                          color: '#065f46'
                        }}
                      >
                        {state}
                      </div>
                    ))}
                  </div>
                </div>
              )}
            </div>

            <div style={{ marginBottom: '16px' }}>
              <div style={{ fontWeight: 'bold', marginBottom: '8px', color: '#1f2937' }}>
                All 2-letter code fields found in data:
              </div>
              <div style={{ padding: '12px', backgroundColor: '#f3f4f6', borderRadius: '6px', fontSize: '12px' }}>
                {Object.keys(stateFrequency).length === 0 ? (
                  <div style={{ color: '#d97706' }}>No 2-letter codes found (Brazilian state codes should be 2 letters)</div>
                ) : (
                  <div>
                    {Object.entries(stateFrequency)
                      .sort((a, b) => b[1] - a[1])
                      .map(([code, count]) => (
                        <div key={code} style={{ marginBottom: '4px', padding: '6px', backgroundColor: '#e5e7eb', borderRadius: '4px' }}>
                          <span style={{ fontWeight: 'bold', color: '#1f2937' }}>{code}</span>: appears {count} times
                        </div>
                      ))}
                  </div>
                )}
              </div>
            </div>
          </>
        )}
      </Section>

      {/* Statistics */}
      <Section title="üìä Data Statistics" section="stats">
        {data.length === 0 ? (
          <div style={{ padding: '12px', backgroundColor: '#fee2e2', borderRadius: '6px', color: '#991b1b' }}>
            ‚ùå No data to analyze
          </div>
        ) : (
          <>
            <InfoBox label="Total Records" value={data.length} color="#3b82f6" />
            <InfoBox label="Null/Empty Records" value={data.filter(d => !d || Object.keys(d).length === 0).length} color="#ef4444" />
            <InfoBox label="Records with State value" value={data.filter(d => d?.[COLUMNS.customerState]).length} color="#10b981" />

            <div style={{ marginTop: '16px', padding: '12px', backgroundColor: '#f0f9ff', borderRadius: '6px' }}>
              <div style={{ fontWeight: 'bold', marginBottom: '8px', color: '#0284c7' }}>Sample values for each column:</div>
              <div style={{ fontSize: '11px' }}>
                {actualColumns.slice(0, 5).map(col => {
                  const sampleValue = data.find(d => d?.[col])?.[col];
                  return (
                    <div key={col} style={{ marginBottom: '8px', padding: '8px', backgroundColor: '#ecf0ff', borderRadius: '4px' }}>
                      <div style={{ color: '#0284c7', fontWeight: 'bold' }}>{col}:</div>
                      <div style={{ marginTop: '4px', color: '#1f2937' }}>{JSON.stringify(sampleValue)}</div>
                    </div>
                  );
                })}
              </div>
            </div>
          </>
        )}
      </Section>

      {/* Next Steps */}
      <div style={{ marginTop: '30px', padding: '20px', backgroundColor: '#ecfdf5', borderLeft: '4px solid #10b981', borderRadius: '6px' }}>
        <div style={{ fontWeight: 'bold', fontSize: '16px', color: '#059669', marginBottom: '12px' }}>üìù Next Steps</div>
        <ol style={{ marginLeft: '20px', color: '#065f46', lineHeight: '1.8' }}>
          <li><strong>If "API Connection Error":</strong> Your backend isn't running. Start it on http://localhost:5000</li>
          <li><strong>If columns don't match:</strong> Update the COLUMNS object with actual column names from your API</li>
          <li><strong>If no state values found:</strong> Check that the customer state column name is correct</li>
          <li><strong>If state codes look wrong:</strong> Make sure they're 2-letter Brazilian state codes (SP, RJ, MG, etc.)</li>
          <li><strong>Once fixed:</strong> The main dashboard will automatically use the correct column names</li>
        </ol>
      </div>

      {/* Copy Debug Info */}
      <div style={{ marginTop: '20px', textAlign: 'center' }}>
        <button
          onClick={() => {
            const debugInfo = {
              apiUrl: API_BASE_URL,
              dataLoaded: data.length,
              actualColumns: actualColumns,
              expectedColumns: Object.values(COLUMNS),
              stateValues: stateValues,
              firstRecord: data[0] || null
            };
            navigator.clipboard.writeText(JSON.stringify(debugInfo, null, 2));
            alert('Debug info copied to clipboard!');
          }}
